import React from "react";

export default function DashboardSidebar({ active, setActive }) {
  const items = [
    "Overview",
    "Employers Profile",
    "Post a Job",
    "My Jobs",
    "Saved Candidate",
    "Plans & Billing",
    "All Companies",
    "Settings"
  ];

  return (
    <aside className="w-64 pr-6">
      <div className="mb-6 flex items-center gap-3">
        <div className="bg-blue-600 text-white p-2 rounded"><svg width="20" height="20" viewBox="0 0 24 24" fill="none"><path d="M6 7h12l1 12H5L6 7z" stroke="white" strokeWidth="1.5"/></svg></div>
        <div className="text-lg font-semibold">Jobpilot</div>
      </div>

      <nav className="space-y-2 text-sm text-gray-600">
        {items.map((it) => (
          <div key={it}
               onClick={() => setActive(it)}
               className={`flex items-center gap-3 p-2 rounded hover:bg-gray-100 cursor-pointer ${active === it ? "bg-blue-50 text-blue-600" : ""}`}>
            <div className="w-6 h-6 bg-gray-100 rounded flex items-center justify-center text-xs">{it[0]}</div>
            <div>{it}</div>
          </div>
        ))}
      </nav>

      <div className="mt-8 text-sm text-gray-500">
        <button className="flex items-center gap-2 px-3 py-2 rounded hover:bg-gray-100">
          <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><path d="M17 16l4-4m0 0l-4-4m4 4H7" stroke="#777" strokeWidth="1.5" strokeLinecap="round"/></svg>
          Log-out
        </button>
      </div>
    </aside>
  );
}
